    const handleNameChange =()=>{
        const names = ['Pot','Frank','Jims'];
        const int = Math.floor(Math.random()*3);
        return names[int];
    }

    const handleClick =()=>{
        console.log("You click me!");
    }
  return (
    <main>
        <p>Hello {handleNameChange() }!</p>
        <button onClick={handleClick}>Click Me!</button>
    </main>
  )
}

export default Content
